#if PRECOMPUTING

int main(){
  printf("!     "); // = 1
  ull m = (1ull << 32) - 5;
  ull f = 1;
  ull x = 0;
  ull limit;

  for(int z = 0; z < (1 << (32 - BLOCKBITS)); z++){
    limit = x + (1 << BLOCKBITS);
    for(; x < limit;){
      f = (f * ++x) % m;
    }
    printf("%c%c%c%c%c%c", ' ' + (f >> 0) % 64
                         , ' ' + (f >> 6) % 64
                         , ' ' + (f >> 12) % 64
                         , ' ' + (f >> 18) % 64
                         , ' ' + (f >> 24) % 64
                         , ' ' + (f >> 30) % 64);
  }
}

#else // if ! PRECOMPUTING

#define scan(x) do{while((x=getchar())<'0'); for(x-='0'; '0'<=(_=getchar()); x=(x<<3)+(x<<1)+_-'0');}while(0)
int main(){
  register char _;
  ull m = (1ull << 32) - 5;
  ull f, x;
  ull limit, n;
  int N;
  scan(N);
  for(int i = 0; i < N; i++){
    scan(n);
    if(n >= m){
      puts("0\n");
      continue;
    }
    f = (((ull)(precompute[6 * (n >> BLOCKBITS) + 0] - ' ')) << 0)
      + (((ull)(precompute[6 * (n >> BLOCKBITS) + 1] - ' ')) << 6)
      + (((ull)(precompute[6 * (n >> BLOCKBITS) + 2] - ' ')) << 12)
      + (((ull)(precompute[6 * (n >> BLOCKBITS) + 3] - ' ')) << 18)
      + (((ull)(precompute[6 * (n >> BLOCKBITS) + 4] - ' ')) << 24)
      + (((ull)(precompute[6 * (n >> BLOCKBITS) + 5] - ' ')) << 30);
    x = (n >> BLOCKBITS) << BLOCKBITS;
    limit = n;
    for(; x < limit;){
      f = (f * ++x) % m;
    }
    printf("%llu\n", f);
  }
}

#endif // PRECOMPUTING
